// App.js

import React, {
  Component
} from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';
import Contact from './pages/Contact';
import Navbar from './components/Navbar';

class App extends Component {
  render() {
    return ( <
      Router >


      <
      div >
      <
      Navbar / >
      <
      Routes >
      <
      Route path = "/"
      element = {
        < Home / >
      }
      /> <
      Route path = "/contact"
      element = {
        < Contact / >
      }
      /> <
      Route path = "/about"
      element = {
        < About / >
      }
      /> <
      /Routes> <
      /div> <
      /Router>
    );
  }
}

export default App;
